var c = document.getElementById('c')
var v = document.getElementById('v')
var mg = document.querySelector('html')
var install = document.getElementById('mg')
var video = document.getElementById('video')

// video.pause()
var game;
var gameLoaded = false;
var createOnLoaded = false;
var this_, hand_arr = [],
    answer_arr = [],
    num = 0
window.onload = function () {
    c.style.visibility = "hidden";
    var gameConfig = {
        type: Phaser.AUTO,
        parent: 'c',
        width: 512,
        height: 800,
        backgroundColor: 0x000000,
        scene: [playGame]
    };
    game = new Phaser.Game(gameConfig);
}

class playGame extends Phaser.Scene {

    constructor() {
        super("PlayGame");
    }

    preload() {
        if (gameLoaded) {
            return;
        }

        var pic_name = [],
            addFlag = false;

        for (var p1 in assets) {
            if (assets.hasOwnProperty(p1))
                pic_name.push(p1);
        }
        for (var i = 0; i < pic_name.length; i++) {
            this.textures.addBase64(pic_name[i], eval("assets." + pic_name[i]))
        }

        var imageCount = pic_name.length;
        var loadedCount = 0;
        this.textures.on('addtexture', function () {
            loadedCount++;
            if (imageCount == loadedCount) {
                gameLoaded = true;
                if (createOnLoaded) {
                    this.create();
                }
            }
        }, this);
    }

    create() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }
        this_ = this
        video.play()
        this.bg = this.add.image(256, 400, 'bg1')
        this.hand()
        install.onclick = function (params) {
            landingPage()
        }
        this.install = this.add.image(256,0,'button').setOrigin(0.5,0).setInteractive().setDepth(5).on('pointerdown',function () {
            landingPage()
        })

        // this.rabbit()

        this.resize();
        window.addEventListener("resize", this.resize, false);
    }

    update() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }
        // console.log(video.currentTime.toFixed(1))
        this.showHand()
        if (video.currentTime.toFixed(1) == 3.5 && num == 0) {
            c.style.visibility = "visible";
            video.pause()
            setTimeout(() => {
                this.rabbit()
                setTimeout(() => {
                    this.hand.visible = 1
                }, 400);
            }, 500);
            num = 1
        }
        if (answer_arr[0] == 'dress') {
            setTimeout(() => {
                video.play()
                c.style.visibility = 'hidden'
                this.bg.destroy()
                this.bg = this.add.image(256, 400, 'bg2')
            }, 100);
            answer_arr = []
        }

        if (video.currentTime.toFixed(1) == 5.7 && num == 1) {
            c.style.visibility = "visible";
            video.pause()
            setTimeout(() => {
                this.balloon()
            }, 500);
            num = 2
        }

        if (answer_arr[0] == 'balloon') {
            setTimeout(() => {
                video.play()
                c.style.visibility = 'hidden'
                this.bg.destroy()
                this.bg = this.add.image(256, 400, 'bg3')

            }, 100);
            answer_arr = []
        }
        if (video.currentTime.toFixed(1) == 9.0 && num == 2) {
            c.style.visibility = "visible";
            video.pause()
            setTimeout(() => {
                this.makeup()
            }, 500);
            num = 3
        }
        if (answer_arr[0] == 'makeup') {
            setTimeout(() => {
                video.play()
                c.style.visibility = 'hidden'
            }, 500);
            answer_arr = []
        }
        if (video.currentTime.toFixed(1) == 22.0 && num == 3) {
            video.onclick = function () {
                landingPage()
            }
            num = 4
        }
    }

    rabbit() {
        var plate = this.add.image(256,580,'words').setScale(0,0).setAlpha(0.0001)
        var dress1 = this.add.image(128,650,'dress1').setInteractive().setScale(0,0)
        var drass1 = this.add.image(384,650,'drass1').setInteractive().setScale(0,0)
        this.tweens.add({
            targets:[plate,drass1,dress1],
            scaleX:1,
            scaleY:1,
            duration:300,
            onComplete:()=>{
               dress1.on('pointerdown',function () {
                    dress2.visible = 1
                    // answer_arr.push('dress')
                    this.hand.visible = 0
                    this.tweens.add({
                        targets:[plate,dress1,dress2,drass1,drass2],
                        delay:200,
                        scaleX:0,
                        scaleY:0,
                        alpha:0,
                        duration:300,
                        onComplete:()=>{
                            answer_arr.push('dress')
                        }
                    })
                },this)
                var dress2 = this.add.image(128,650,'dress2').setVisible(0)
                drass1.on('pointerdown',function () {
                    drass2.visible = 1
                    setTimeout(() => {
                        drass2.visible = 0
                    }, 200);
                })
                var drass2 = this.add.image(384,650,'drass2').setVisible(0)
            }
        })
    }
    balloon() {
        var plate = this.add.image(256,580,'words').setScale(0,0).setAlpha(0.0001)
        var balloon1 = this.add.image(384,650,'balloon1').setInteractive().setScale(0,0)
        var bolloon1 = this.add.image(128,650,'bolloon1').setInteractive().setScale(0,0)
        this.tweens.add({
            targets:[plate,balloon1,bolloon1],
            scaleX:1,
            scaleY:1,
            duration:300,
            onComplete:()=>{
                balloon1.on('pointerdown',function () {
                    balloon2.visible = 1
                    // answer_arr.push('dress')
                    this.hand.visible = 0
                    this.tweens.add({
                        targets:[plate,balloon1,balloon2,bolloon1,bolloon2],
                        delay:200,
                        scaleX:0,
                        scaleY:0,
                        alpha:0,
                        duration:300,
                        onComplete:()=>{
                            answer_arr.push('balloon')
                        }
                    })
                },this)
                var balloon2 = this.add.image(384,650,'balloon2').setVisible(0)
                bolloon1.on('pointerdown',function () {
                    bolloon2.visible = 1
                    setTimeout(() => {
                        bolloon2.visible = 0
                    }, 200);
                })
                var bolloon2 = this.add.image(128,650,'bolloon2').setVisible(0)
            }
        })
    }
    makeup() {
        // var zzc = this.add.image(0, 0, 'bg3').setOrigin(0, 0).setDepth(5).setInteractive().setAlpha(0.001).once(
        //     'pointerdown',
        //     function (params) {
        //         this.showDownload()
        //     }, this
        // )
        var plate = this.add.image(256,580,'words').setScale(0,0).setAlpha(0.0001)
        var makeup1 = this.add.image(128,650,'makeup1').setInteractive().setScale(0,0)
        var makeon1 = this.add.image(384,650,'makeon1').setInteractive().setScale(0,0)
        this.tweens.add({
            targets:[plate,makeon1,makeup1],
            scaleX:1,
            scaleY:1,
            duration:300,
            onComplete:()=>{
                makeup1.on('pointerdown',function () {
                    makeup2.visible = 1
                    // answer_arr.push('dress')
                    this.hand.visible = 0
                    this.tweens.add({
                        targets:[plate,makeup1,makeup2,makeon2,makeon1,],
                        delay:200,
                        scaleX:0,
                        scaleY:0,
                        alpha:0,
                        duration:300,
                        onComplete:()=>{
                            answer_arr.push('makeup')
                        }
                    })
                },this)
                var makeup2 = this.add.image(128,650,'makeup2').setVisible(0)
                makeon1.on('pointerdown',function () {
                    makeon2.visible = 1
                    setTimeout(() => {
                        makeon2.visible = 0
                    }, 200);
                })
                var makeon2 = this.add.image(384,650,'makeon2').setVisible(0)
            }
        })

    }

    showDownload() {
        var rect = new Phaser.Geom.Rectangle(0, 0, game.config.width, game.config.height);
        var graphics1 = this.add.graphics({
            fillStyle: {
                color: 0x000000
            }
        });
        graphics1.alpha = 0.2;
        graphics1.setDepth(8);
        graphics1.fillRectShape(rect);
        var win_bg = this.add.image(256, -400, 'nice').setDepth(10)
        var down = this.add.image(256, 520, 'continue').setDepth(10).setScale(0, 0).setInteractive().on('pointerdown', () => {
            landingPage()
        })
        this.tweens.add({
            targets: [win_bg],
            y: 400,
            duration: 800,
            ease: 'Back',
            onComplete: () => {
                this.tweens.add({
                    targets: [down],
                    scaleX: 1,
                    scaleY: 1,
                    duration: 500,
                    onComplete: () => {
                        setInterval(() => {
                            this.tweens.add({
                                targets: [down],
                                scaleX: 1.1,
                                scaleY: 1.1,
                                duration: 300,
                                onComplete: () => {
                                    this.tweens.add({
                                        targets: [down],
                                        scaleX: 1,
                                        scaleY: 1,
                                        duration: 300,
                                        onComplete: () => {

                                        }
                                    })
                                }
                            })
                        }, 600);

                    }
                })
            }
        })
    }
    hand() {
        this.hand = this.add.image(-100, 0, 'hand').setDepth(10).setOrigin(0.3, 0.1).setVisible(0)
        setInterval(() => {
            this.tweens.add({
                targets: [this.hand],
                scaleX: 1,
                scaleY: 1,
                duration: 300,
                onComplete: () => {
                    this.tweens.add({
                        targets: [this.hand],
                        scaleX: 1.1,
                        scaleY: 1.1,
                        duration: 300,
                        onComplete: () => {}
                    })
                }
            })
        }, 600);
    }
    showHand() {

        if (hand_arr.length == 0) {
            this.hand.x = 128 
            this.hand.y = 660
        }
        // if (hand_arr[hand_arr.length - 1] == 'i') {
        //     this.hand.x = 256 + 80
        //     this.hand.y = 690 - 10
        // }


    }
    resize() {
        var canvas = document.querySelector("canvas");
        var windowWidth = window.innerWidth;
        var windowHeight = window.innerHeight;
        var windowRatio = windowWidth / windowHeight;
        var gameRatio = game.config.width / game.config.height;
        if (windowRatio < gameRatio) {
            canvas.style.width = windowWidth + "px";
            canvas.style.height = (windowWidth / gameRatio) + "px";
            v.style.width = windowWidth + "px";
            v.style.height = (windowWidth / gameRatio) + "px";
            c.style.width = windowWidth + "px";
            c.style.height = (windowWidth / gameRatio) + "px";
            mg.style.width = windowWidth + "px";
            mg.style.height = (windowWidth / gameRatio) + "px";
        } else {
            canvas.style.width = (windowHeight * gameRatio) + "px";
            canvas.style.height = windowHeight + "px";
            v.style.width = (windowHeight * gameRatio) + "px";
            v.style.height = windowHeight + "px";
            c.style.width = (windowHeight * gameRatio) + "px";
            c.style.height = windowHeight + "px";
            mg.style.width = (windowHeight * gameRatio) + "px";
            mg.style.height = windowHeight + "px";
        }
    }
}

